import React from 'react'
import useMenus from '../data/useMenus'


const MenusPrimary = () => {
    var menuData = '';
    var menuItemPrimary = [];
    const menusInfo = useMenus();
    menusInfo.map(item => (
        menuData = item
    ))
    if (menuData.length > 0 ) {
        menuData.map((item,index) => (
            item.locations == 'PRIMARY' ? menuItemPrimary = item.menuItems.nodes : null
        ))
    }
    if (menuItemPrimary.length > 0) {
        return (
            menuItemPrimary.map(item => (
                item.label
            ))
        )
    }
}

export default MenusPrimary
